import './App.css';
import ExperimentForm from './ExperimentForm';

function App() {
    const formIds = [
        'https://docs.google.com/forms/d/e/1FAIpQLSc50Ja6sIGcTQKQBni4CRBYkIMipjzfFkj5sTDiZbl5FX_CbQ/viewform?embedded=true',
        'https://docs.google.com/forms/d/e/1FAIpQLSf3lZQoBjpJaOnzWid7LQ5Ntc98vMFBJNXl5hryiiagpgdoFg/viewform?embedded=true',
        'https://docs.google.com/forms/d/e/1FAIpQLSeiM1yS-2yS90Enyk7uSsnCTWoThULWu3InAtwgHgeiovBcAA/viewform?embedded=true',
    ];

    return (
        <div className='App'>
            <ExperimentForm url={formIds.random()} />
        </div>
    );
}

export default App;

Array.prototype.random = function () {
    return this[Math.floor(Math.random() * this.length)];
};
